import logo from './logo.svg';
import './Login.css';

import React from "react";
import {
Button,
TextField,
Grid,
Paper,
AppBar,
Typography,
Toolbar,
Link,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles((theme) => ({
  customBorderRadius: {
    borderRadius: 5,
    width: '396px',
    padding: '20px 0px 28px',
    margin: '45% auto',
    textAlign: 'center',
  }
}));

function Login() {
  const classes = useStyles();

  return (
    <div className="main">
      <Grid container justify="center">
      <Grid item>
          <Grid container justify="center" direction="column" className="login-form">
            <Grid item>
              <img src={logo} className="App-logo" alt="logo" />
            </Grid>
            <Grid item>
              <h1 class="large">
              ipon.app
              </h1>
            </Grid>
            <Grid item>
            <p class="tag-large">
            Simplest way to track your expenses.
            </p>
            </Grid>

            <Grid item>
            <p class="tag-next-large">
              Because every peso counts.
            </p>
            </Grid>
          </Grid>
        </Grid>
        <Grid item>
          <Paper variant="elevation" elevation={10} className={classes.customBorderRadius}>
            <h1>ipon.app</h1>
            <div>Sign in</div>
          </Paper>
        </Grid>
      </Grid>
  </div>
  );
}

export default Login;
